import './App.css';
import React, { Component } from 'react'

import { ObjectRow} from 'react';

class App extends Component {

  url = 'http://localhost:8080/user/alex'
  name = ''
  state = []

  componentDidMount() {
    fetch(this.url, {method: 'POST'})
    .then(res => res.json())
    .then((data) => {
      this.state.push(data)
      console.log(this.state)
      this.render()
    })
    .catch(console.log)
  }

  render() {

    if (!this.state) {
      return ''
    }
    console.log('state: ', this.state)

    return (
      <tbody>
        {this.state?.forEach(user => <ObjectRow key={user.id} />)}
      </tbody>
    )
    // return (
